  \"Response of Greater Snow Geese to Hunting at Bombay Hook NWR and Related Wetland
  Changes.\",\n\t\"tracking_summary\": {\n\t\t\"total\": 17,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2016-07-27T22:58:11.414906\",\n\t\"name\":
  \"response-of-greater-snow-geese-to-hunting-at-bombay-hook-nwr-and-related-wetland-changes\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Wintering snow goose populations have increased
  dramatically in the vicinity of Bombay Hook National Wildlife Refuge during the
  last 20 years. Peak populations have risen from 1,500 in 1968 to over 198,000 in
  1997. The birds concentrate their feeding activities in a relatively small portion
  of the refuge salt marshes and create \"eatouts\", areas of marsh stripped of vegetation,
  following their feeding activities. Beginning with the 1983-84 season the refuge
  opened portions of the marshes to public snow goose hunting. Since it was noted
  that most damage occurred shortly after the birds arrived in October, a special
  early hunt was permitted prior to the regular State waterfowl season beginning in
  1987-88 which has continued since that time. With the advent of snow goose hunting
  in Bombay Hook's marshes changes in the birds' use patterns on Bombay Hook and surrounding
  areas were noted. Concentrations of the birds began using Prime Hook National Wildlife
  Refuge, the Little Creek Wildlife Management Area, as well as private lands to the
  west into Maryland's eastern shore. This study was proposed to documentand monitor
  the habitat preferences, population fluctuations, and vegetation changes associated
  with  the snow goose flocks in the Bombay Hook Area.\",\n\t\"license_title\": \"License
